import React from "react";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
// import axios from "axios";
import "./navbar.css";

class Navi extends React.Component {
    render(){
      return (
        <Navbar>
          <Navbar.Brand href = ""><h1>Navbar</h1></Navbar.Brand>
            <Navbar.Toggle title="" id="collasible-nav-dropdown">
            <Nav.Item href="">Education</Nav.Item>
            <NavDropdown.Item href="">Work Experience</NavDropdown.Item>
            <NavDropdown.Item href="">Projects</NavDropdown.Item>
            <NavDropdown.Item href="">Interests</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="">Contact</NavDropdown.Item>
            </Navbar.Toggle>
          </Navbar>
      )
    } 
}
    
  export default Navi;
